tainer.", "id": "ContainerHealthDetails", "properties": { "extendedStatus": { "description": "The extended status. Such as ExitCode, StartedAt, FinishedAt, etc.", "additionalProperties": { "type": "string" }, "type": "object" }, "errorMsg": { "type": "string", "description": "The latest error message." }, "expectedConfigVersion": { "type": "string", "description": "The version of the expected config." }, "currentConfigVersion": { "type": "string", "description": "The version of the current config." } }, "type": "object" }, "ImageConfig": { "description": "ImageConfig defines the control plane images to run.", "type": "object", "properties": { "stableImage": { "type": "string", "description": "The stable image that the remote agent will fallback to if the target image fails." }, "targetImage": { "type": "string", "description": "The initial image the remote agent will attempt to run for the control plane." } }, "id": "ImageConfig" }, "GoogleIamV1AuditConfig": { "properties": { "auditLogConfigs": { "type": "array", "items": { "$ref": "GoogleIamV1AuditLogConfig" }, "description": "The configuration for logging of each type of permission." }, "service": { "description": "Specifies a service that will be enabled for audit logging. For example, `storage.googleapis.com`, `cloudsql.googleapis.com`. `allServices` is a special value that covers all services.", "type": "string" } }, "type": "object", "id": "GoogleIamV1AuditConfig", "description": "Specifies the audit configuration for a service. The configuration determines which permission types are logged, and what identities, if any, are exempted from logging. An AuditConfig must have one or more AuditLogConfigs. If there are AuditConfigs for both `allServices` and a specific service, the union of the two AuditConfigs is used for that service: the log_types specified in each AuditConfig are enabled, and the exempted_members in each AuditLogConfig are exempted. Example Policy with multiple AuditConfigs: { \"audit_configs\": [ { \"service\": \"allServices\", \"audit_log_configs\": [ { \"log_type\": \"DATA_READ\", \"exempted_members\": [ \"user:jose@example.com\" ] }, { \"log_type\": \"DATA_WRITE\" }, { \"log_type\": \"ADMIN_READ\" } ] }, { \"service\": \"sampleservice.googleapis.com\", \"audit_log_configs\": [ { \"log_type\": \"DATA_READ\" }, { \"log_type\": \"DATA_WRITE\", \"exempted_members\": [ \"user:aliya@example.com\" ] } ] } ] } For sampleservice, this policy enables DATA_READ, DATA_WRITE and ADMIN_READ logging. It also exempts `jose@example.com` from DATA_READ logging, and `aliya@example.com` from DATA_WRITE logging." }, "ResolveConnectionsResponse": { "id": "ResolveConnectionsResponse", "description": "Response message for BeyondCorp.ResolveConnections.", "properties": { "nextPageToken": { "type": "string", "description": "A token to retrieve the next page of results, or empty if there are no more results in the list." }, "unreachable": { "type": "array", "description": "A list of locations that could not be reached.", "items": { "type": "string" } }, "connectionDetails": { "description": "A list of BeyondCorp Connections with details in the project.", "items": { "$ref": "ConnectionDetails" }, "type": "array" } }, "type": "object" }, "Ingress": { "properties": { "config": { "description": "The basic ingress config for ClientGateways.", "$ref": "Config" } }, "description": "Settings of how to connect to the ClientGateway. One of the following options should be set.", "id": "Ingress", "type": "object" }, "GoogleLongrunningCancelOperationRequest": { "properties": {}, "type": "object", "id": "GoogleLongrunningCancelOperationRequest", "description": "The request message for Operations.CancelOperation." }, "CloudSecurityZerotrustApplinkLogagentProtoLogAgentDetails": { "type": "object", "id": "CloudSecurityZerotrustApplinkLogagentProtoLogAgentDetails", "description": "LogAgentDetails reflects the details of a log agent.", "properties": {} }, "Config": { "type": "object", "description"